import { useEffect, useState } from "react";
import dayjs from "dayjs";
import { Outlet } from "react-router";
import "./App.css";

interface Props {
  copyright: string;
  date: string;
  explanation: string;
  hdurl: string;
  media_type: string;
  service_version: string;
  title: string;
  url: string;
}

function App() {
  const [images, setImages] = useState<Props[]>([]);
  useEffect(() => {
    fetch(
      "https://api.nasa.gov/planetary/apod?api_key=DJnbcPU0nmH4c9DUejNgqxVpFh8wB61Jo8RiHeLc&start_date=2024-08-23&end_date=2024-08-30"
    )
      .then((response) => response)
      .then((e) => e.json())
      .then((e) => setImages(e));
  }, []);

  dayjs("2019-01-25").format();
  console.log("dayass", dayjs("2019-01-25").format());

  return (
    <div className="App">
      {images.map((item, index) => (
        <li key={index}>{item.copyright}</li>
      ))}
      <Outlet />
    </div>
  );
}

export default App;
